import React, { useState, useEffect } from "react";
import api from "../../api";

const UserPage = () => {
  const [users, setUsers] = useState();
  useEffect(() => {
    api.users
      .getById("67rdca3eeb7f6fgeed47181f")
      .then((data) => (data.name));
  }, []);
  console.log(users);
  return <h1>{`${users.name}`}</h1>;
};

export default UserPage;
